import { React, Fragment } from 'react';
import PropTypes from 'prop-types';

const Dashboard = props => {
  return (
    <Fragment>
      <h1 classname='large text-primary'>Dashboard</h1>
    </Fragment>
  );
};

Dashboard.propTypes = {};

export default Dashboard;
